
def findWords(board, words):
    """
    :type board: List[List[str]]
    :type words: List[str]
    :rtype: List[str]
    """
    m,n = len(board),len(board[0])
    head = [word[0] for word in words]
    start = {}
    # O(m*n) to find starting point of search
    for i in range(m):
        for j in range(n):
            c = board[i][j]
            if c in head:
                if not c in start: start[c]=[]
                start[c].append((i,j))

    def neighb(i,j):
        if i-1>=0: yield i-1,j
        if i+1<m: yield i+1,j
        if j-1>=0: yield i,j-1
        if j+1<n: yield i,j+1

    # try to find every word
    found = []

    def dfs(i,j,word,ind):
        if ind == len(word):
            found.append(word)
            return
        for nbi,nbj in neighb(i,j):
            #if len(c)>25: print ((nbi,nbj),board[nbi][nbj],visited)
            if board[nbi][nbj] == word[ind]:
                board[nbi][nbj] = None
                dfs(nbi,nbj,word,ind+1)
                board[nbi][nbj] = word[ind]

    for word in words:
        if word[0] in start:
            for i,j in start[word[0]]:
                board[i][j] = None
                x = len(found)
                dfs(i,j,word,1)
                board[i][j] = word[0]
                if len(found) > x: print (x); break


    return list(set(found))

